import React, { Component } from 'react';
import {
    BrowserRouter as Router,
    Route,
    Link,
    NavLink
} from 'react-router-dom'
import Menu from "./Components/Menu";
import Progress_bar from "./Components/Progress_bar";
import Slide from "./Components/Slide";
import Advantage from "./Components/Advantage";
import Totop from "./Components/Totop";
import Client from "./Components/Client";
import Topsells from "./Components/Topsells";
import Title from "./Components/Title";

class App extends Component {
  render() {
    return (
        <Router>
            <div>
                <Progress_bar/>
                <Totop/>
                <Menu/>
                <Slide/>
                <Title tieude="Thế mạnh" colr="orangred" kieucd="fade-up" />
                <Advantage/>
                <Title tieude="Top giao diện bán nhiều nhất" colr="aquamarine" kieucd="zoom-in-down"/>
                <Topsells/>
                <Title tieude="Đối tác của chúng tôi" colr="navy" kieucd="zoom-in-down"/>
                <Client/>
            </div>
        </Router>
    );
  }
}

export default App;
